Colorist:  Richard Horie and Tanya Horie
Letterer:  Ken Lopez
Cover:  Pasqual Ferry and Paul Neary (#130); Carlos Pacheco and Jesus Merino(#131)

Superman: The Man of Steel #130
&quot;Ending Battle&quot; part 3, continued from The Adventures of Superman #608. The Daily Planet is attacked by Evilstar and his Starlings, while a more powerful Terra-Man and Rock attack the Steelworks, forcing Lois to decide if her duty as a reporter comes before her duty to Superman. Continued in Action Comics v1 #795.

Superman: The Man of Steel #131
&quot;Ending Battle&quot; part 7, continued from The Adventures of Superman #609. Facing the combined might of Mongul, Bizarro, Master Jailer, and Silver Banshee, Superman doesn't stand a chance to get to Lois before she finds the unexpected visitor at her doorstep! Continued in Action Comics v1 #796.

